import React from 'react';
import PortfolioHero from './components/PortfolioHero';
import ProjectsGrid from './components/ProjectsGrid';
import PortfolioFooter from './components/PortfolioFooter';

const App = () => {
  return (
    <div className="bg-white">
      <PortfolioHero />
      <ProjectsGrid />
      <PortfolioFooter />
      <h1>Hello</h1>
    </div>
  );
};

export default App;

